import React from 'react';

import {ArticlePageController} from './ArticlePageController';
import {
    DivMainContainer,
    DivMainContainerInner,
    DivMainLeft,
    DivMainRight
}
    from './ArticlePageElement';

import {DefaultColor} from '../../components/config';

class ArticlePage extends ArticlePageController {

    render() {
        let article = this.state.detail;
        console.log(article);
        return (
            <DivMainContainer>
                <DivMainContainerInner>
                    <DivMainLeft>
                        <Header >   
                            <DivFloat 
                                flexDirection="column" 
                                justifyContent="flex-end" 
                                alignItems="flex-start" 
                                width="80%" 
                            >
                                <br/><br/>
                                <div
                                style={{color:DefaultColor,fontSize:30,fontFamily:"Dancing Script"}}
                                >
                                    {(article!=null?article.title:"loading...")}<br/>
                                </div>

                                <div 
                                style={{color:DefaultColor,marginTop:5,fontSize:25,fontFamily:"Darker Grotesque"}}
                                >
                                    {(article!=null?article.intro:"loading...")}
                                </div><br/>
                            </DivFloat>
                        </Header>
                    </DivMainLeft>
                    <DivMainRight></DivMainRight>
                </DivMainContainerInner>



            </DivMainContainer>
        );
    }
}



export {ArticlePage};
